import React from "react";
import { Navbar } from "reactstrap";

const NavBar =()=>
{
    return(
        <div id="div3" className="text-center" style={{backgroundColor:"yellowgreen"}} aria-expanded="false">
            <ul>
            <li class="nav-item" ng-class="{serviceActive:isActive('/paidDarshanAvailability')}">
			<a class="nav-link" href="#/paidDarshanAvailability"><span class="nav-link-clr ng-binding">Darshan</span> </a>
			</li>

            
            </ul>
        </div>
    )
}

export default Navbar;
